import React, { useEffect, useState } from "react";
import { Navbar, Nav, Container, NavDropdown, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import { varibales } from "../../Variables";
import { BasketCard } from "./priceOption/CardItems/BasketCard";

export default function Header({ Email, setEmail, orders, deleteOrder, data, sum, setSum, deleteAllOrders }) {
  const logout = async () => {
    await fetch(varibales.API_URL + "logout", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      credentials: 'include'
    });
    localStorage.clear();
    setEmail('');
  }
  const [cartOpen, setCartOpen] = useState(false);

  function showOrders(orders) {
    return (
      <>
        <div>
          <span className="playfair color-brand-gold font-size-24"> Коризна </span>
          <div className="d-flex justify-content-between">
            <p className="montserrat color-dark-shades" style={{ fontSize: '14px' }}> Выбрано {orders.length} абонементов </p>
            <div
              className="montserrat color-dark-shades remove-basket"
              style={{ fontSize: '14px' }}
              onClick={() => { deleteAllOrders(); setSum(0); }}
            > Очистить корзину </div>
          </div>
        </div>
        <div className="scroll-controller-header">
          {orders.map((el) => (
            <BasketCard key={el.Subscription_Id} item={el} orders={orders} deleteOrder={deleteOrder} sum={sum} setSum={setSum} />
          ))}
        </div>
        <div className="d-flex justify-content-between" >
          <div>
            <p className="m-0 mt-2"> Сумма заказа: </p>
            <span className="color-brand-gold font-size-24" style={{ fontWeight: '600' }}>
              {sum}
            </span> грн
          </div>
          <div style={{ lineHeight: '2em' }}>
            {Email === ''
              ? <div className="mt-3" style={{ height: '40px' }}>
                <Link to='/login' className="org-button mt-4 text-decoration-none" style={{ padding: '10px 20px' }}>
                  Оформить заказ
                </Link>
              </div>
              : <div className="mt-3" style={{ height: '40px' }}>
                <Link to='/ordering' className="org-button mt-4 text-decoration-none" style={{ padding: '10px 20px' }}>
                  Оформить заказ
                </Link>
              </div>
            }
          </div>
        </div>
      </>
    )
  }

  function showNothing() {
    return (
      <>
        <div>
          <span className="playfair color-brand-gold font-size-24"> Коризна </span>
        </div>
        <div className="text-center p-4">
          Товаров нет
        </div>
      </>
    )
  }

  return (
    <>
      <div className="Header">
        <Navbar className="my-height w-100" bg="light" expand="lg" fixed="top">
          <div className="position-fixed top-0" style={{ border: '1px solid' }}>
            <span className="p-2" style={{ color: "green" }}> {data.Role} </span>
          </div>
          <Container>
            <Nav className="me-auto my-lg-0 element-to-hide montserrat font-size-18 ">
              <Nav.Link href="/#about"
                className="p-2 text-decoration-none"
              >
                <div className="animate">
                  <span className="color-dark-shades color-light-gray"> О нас</span>
                </div>
              </Nav.Link>
              <Nav.Link href="/#prices"
                className="p-2 text-decoration-none"
              >
                <div className="animate">
                  <span className="color-dark-shades color-light-gray"> Сервисы </span>
                </div>
              </Nav.Link>
              <Nav.Link href="/#reviews"
                className="p-2 text-decoration-none"
              >
                <div className="animate">
                  <span className="color-dark-shades color-light-gray"> Отзывы </span>
                </div>
              </Nav.Link>
            </Nav>
            <Navbar.Toggle className="toggle-left" />
            <Navbar.Brand className="me-auto montserrat">
              <DancingEurydice />
            </Navbar.Brand>

            <Navbar.Collapse className="justify-content-end" style={{ maxWidth: '265px' }}>
              <Nav className="montserrat font-size-18">
                {Email === ''
                  ?
                  <Link
                    to='/login'
                    className="p-2" style={{ textDecoration: 'none' }}>
                    <div className="animate">
                      <span className="color-dark-shades color-light-gray">
                        <svg xmlns="http://www.w3.org/2000/svg" width="25" height="25" fill="currentColor" className="bi bi-person-circle color-dark-shades " viewBox="0 0 16 16">
                          <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0z" />
                          <path fillRule="evenodd" d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8zm8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1z" />
                        </svg>
                        Войти
                      </span>
                    </div>
                  </Link>
                  :
                  <div>
                    <NavDropdown
                      title={Email}
                      id="navbarScrollingDropdown"
                      onClick={() => setCartOpen(false)}
                    >
                      <Link to='/profile'
                        className="drop-link"
                      >
                        Профиль
                      </Link>
                      <NavDropdown.Divider />
                      <Link to='/' reloadDocument
                        className="drop-link"
                        onClick={logout}>
                        Выход
                      </Link>
                    </NavDropdown>
                  </div>
                }

                <Nav.Link href="/#contacts"
                  className="p-2 text-decoration-none"
                >
                  <div className="animate">
                    <span className="color-dark-shades color-light-gray"> Контакты </span>
                  </div>
                </Nav.Link>
                <Nav.Link className="pt-1">
                  <div className="d-flex position-relative">
                    <motion.div
                      className={`shop-cart-button animate ${cartOpen ? 'active' : ''}`}
                      whileHover={cartOpen ? { rotate: 0 } : { rotate: 15 }}
                      onClick={() => setCartOpen(!cartOpen)}
                    >
                      <span>
                        <svg xmlns="http://www.w3.org/2000/svg" width="30" height="30" fill="currentColor" className="bi bi-cart4 color-dark-shades" viewBox="0 0 16 16" >
                          <path d="M0 2.5A.5.5 0 0 1 .5 2H2a.5.5 0 0 1 .485.379L2.89 4H14.5a.5.5 0 0 1 .485.621l-1.5 6A.5.5 0 0 1 13 11H4a.5.5 0 0 1-.485-.379L1.61 3H.5a.5.5 0 0 1-.5-.5zM3.14 5l.5 2H5V5H3.14zM6 5v2h2V5H6zm3 0v2h2V5H9zm3 0v2h1.36l.5-2H12zm1.11 3H12v2h.61l.5-2zM11 8H9v2h2V8zM8 8H6v2h2V8zM5 8H3.89l.5 2H5V8zm0 5a1 1 0 1 0 0 2 1 1 0 0 0 0-2zm-2 1a2 2 0 1 1 4 0 2 2 0 0 1-4 0zm9-1a1 1 0 1 0 0 2 1 1 0 0 0 0-2zm-2 1a2 2 0 1 1 4 0 2 2 0 0 1-4 0z" />
                        </svg>
                      </span>
                    </motion.div>
                    {orders.length > 0
                      ? <div className="orders_length">{orders.length}</div>
                      : ''
                    }
                  </div>
                </Nav.Link>
                {cartOpen && (
                  <div className="shop-cart p-3">
                    {
                      orders.length > 0 ?
                        showOrders(orders) : showNothing()
                    }
                  </div>
                )}
              </Nav>
            </Navbar.Collapse>
            <Navbar.Toggle className="toggle-right" />
          </Container>
        </Navbar>
      </div >
    </>
  );
}

